import React, { Component } from "react";

class Task extends Component {
  render() {
    return (
      <div className="task well m-2 group-btn">
        <input
          type="checkbox"
          onChange={() => this.props.onDelete(this.props.index)}
        />
        <span>{this.props.task}</span>
      </div>
    );
  }
}

export default Task;
